import Myname from './components/name';
function App() {
  const mame = [
    {title : "john", amount : 946, date : new Date(2021, 4, 1)},
    {title : "Chris", amount : 700, date : new Date(2021, 10, 23)},
    {title : "Alinco", amount: 500, date : new Date(2021, 11, 11)},
  ];


  return (
    <div className="App">
      <header className="App-header">

        <a>
          Learn React
        </a>
        <Myname 
        title = {mame[0].title}
        amount ={mame[0].amount}
        date = {mame[0].date}
        ></Myname>
        <Myname 
        title = {mame[1].title} 
        amount ={mame[1].amount}
        date = {mame[1].date}
        ></Myname>
      </header>
    </div>
  );
}

export default App;
